import Header from './components/Header';

function App() {

  const calculator = () => {
    return 3 * 3;
  }

  const ACADEMIA = "IT Academia ";
  const onClickHeader = () => {
    alert("header");
  }



  return (
    <>

      <Header onClick={onClickHeader} />

      <p>{calculator()}</p>
      <p>{ACADEMIA}</p>

    </>
  );
}

export default App;
